import { makeStyles } from "@material-ui/core";
import {Theme} from "../Theme"

export const useStyles = makeStyles(() => ({
    boxAbout: {
        width: "100%",
        minHeight: "90vh",
        height: "auto",
        backgroundColor: Theme.colors.deep,
        padding:"10"
         
    },
    responsiveImg: {
        width: "100%",
        height:"auto"
    }
}))
